import React, { useEffect } from 'react';
import BinarySearchTree from './impl';
import BinarySearchTreeUI, { defaultBSTUIConfig } from './bst-ui';

const BST = () => {
  useEffect(() => {
    // Instantiate BinarySearchTree and BinarySearchTreeUI
    const bst = new BinarySearchTree();
    const bstUI = new BinarySearchTreeUI(bst);

    // Initialize the UI
    bstUI.init();

    // Insert some initial values (optional)
    bst.insert(50);
    bst.insert(30);
    bst.insert(70);
    bst.insert(20);
    bst.insert(40);
    bst.insert(60);
    bst.insert(80);

    // Render the initial tree
    bstUI.render(bst.root);
  }, []);

  return (
    <div>
      <h1>Binary Search Tree Component</h1>
      {/* You can add any additional UI components or elements here */}
    </div>
  );
};

export default BST;
